response.about:
Я Творческий технарь и разносторонний человек

- Профессиональный фотограф;
- Закончил актерские курсы;
- Работал и сотрудничаю с серьезными структурами!;
- Профессионально делаю массаж!;
- Не пью(почти), не курю, не употребляю наркотики;
- По натуре умею быть романтичным и внимательным;
- С львиными замашками лидера, но умеющий слушать!;
- Общительный и коммуникабельный человек;
- Приверженец справедливости и честности!;
- Иногда бываю брутальным и резким!; 
- Революционер и говорю правду в лицо!;
- Люблю организовывать интересные мероприятия;
- Интересуюсь техникой;
- Верный Однолюб;
- Пунктуальный, не люблю людей 
не уважающих мое и свое время!;

Псевдонимы и ники: Маэстро и Paolo Genua
ps...Почти у каждого моего знакомого
- есть фотографии сделанные мною!)

